import React from 'react';
import './App.css';
import './components/Header'
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './pages/home';

function App() {
  return (
    <>
      <Home />
      <Router>
        <Route path='/' element={<Home />}/>
      </Router>
      </>
  )
}

export default App
